[{"location":"#Supplementary-Information-of-*Lipid-Architecture-in-the-Zika-Virus*","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"Camila Assis <b>Tavares</b><sup>1,2</sup>, Martín <b>Soñora</b><sup>3</sup>, Sergio <b>Pantano</b><sup>3</sup>, Leandro <b>Martínez</b><sup>1,2</sup> <br>","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"<span style=\"font-size:0.8em\">\n<sup>1</sup> Institute of Chemistry, Universidade Estadual de Campinas (UNICAMP), Campinas, SP, Brazil <br>\n<sup>2</sup> Center for Computational Engineering & Science, Universidade Estadual de Campinas (UNICAMP), Campinas, SP, Brazil <br>\n<sup>3</sup> Biomolecular Simulations Group, Institut Pasteur de Montevideo, Mataojo 2020, Montevideo, Uruguay<br>\n</span>\n<br>","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"Corresponding author: lmartine@unicamp.br","category":"page"},{"location":"#Overview","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Overview","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"(Image: )","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"This repository contains the supplementary data for the study titled Lipid Architecture in the Zika Virus. The research explores the atomic-level distribution of light-material components within the Zika virus. By using coarse-grained simulations with the ComplexMixtures.jl package, the study analyzed solvation patterns across the viral structure, revealing specific differences and affinities regarding the light-material.","category":"page"},{"location":"#Dependencies","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Dependencies","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"This work was developed using the following software and packages:","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"Julia 1.11.2: Programming language.\nComplexMixtures v2.10.1: For light-material distribution analysis.\nLaTeXStrings v1.4.0: For incorporating LaTeX-style formatting in plot labbels and annotations. \nPDBTools v2.1.2: For handling and analyzing PDB files.\nPlots v1.40.9: For generating high-quality visualizations.","category":"page"},{"location":"#Installation","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Installation","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"The dependencies can be installed in Julia using:","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"using Pkg\nPkg.add([\n    \"ComplexMixtures\",\n    \"LaTeXStrings\",\n    \"PDBTools\",\n    \"Plots\"\n])","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"!!! warning Compatibility             Ensure that you are using Julia 1.11.2 for compatibility with the packages and scipts in the repository.","category":"page"},{"location":"#Funding","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Funding","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"The authors acknowledge the financial support of Fapesp (2018/24293-0, 2023/14353-4). Research developed with the help of Coaraci Supercomputer (2019/17874-0).","category":"page"},{"location":"#References","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"References","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"[1] L. Martínez, ComplexMixtures.jl: Investigating the structure solutions of complex-shaped molecules from a  solvent-shell perspective. J. Mol. Liq. 347, 117945, 2022.","category":"page"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"[2] L. Martínez, S. Shimizu, Molecular interpretation of preferential interactions in protein solvation: a solvent-shell perspective by means of minimum distribution functions. J. Chem. Theor. Comp. 13, 6358-6372, 2017.","category":"page"},{"location":"#Additional-Resources","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Additional Resources","text":"","category":"section"},{"location":"","page":"Supplementary Information of Lipid Architecture in the Zika Virus","title":"Supplementary Information of Lipid Architecture in the Zika Virus","text":"For additional resources and publications related to the scope of this paper, please visit the M3G Website.","category":"page"}]
